import React, { useState, useEffect } from 'react';
import MyNavbar from './components/navbar';
import Users from './components/users';
import Productos from './components/products';
import Categorias from './components/categories';


function App() {
  const [token, setToken] = useState(localStorage.getItem('token'));
  const [activeKey, setActiveKey] = useState('productos'); // default active
  const [activeUser, setActiveUser] = useState(null);

  return (
    <>
      <MyNavbar token={token} setToken={setToken} 
	  activeKey={activeKey} setActiveKey={setActiveKey} 
	  setActiveUserId={setActiveUser}
	  />
      {/* ...your routes/components... */}
	  {activeKey === "productos" && <Productos />}
	  {activeKey === "categorias" && <Categorias />}
      {activeKey === 'usuarios' && token && <Users token={token} activeUser={activeUser} />}
    </>
  );
}

export default App;
